import React from 'react'

const CalendarGrid = () => {

    const numOfDays = 42;
    const days = [...Array(numOfDays)];


    return (
        <div className='gridWrapper'>
            {days.map((i) => {
                <div>
                    {i}
                </div>
            })}
        </div>
    )
}

export default CalendarGrid
